import React from 'react'
import { FullName, Name } from './Fields'
import { UseData } from './API'

export default function Form() {
    const {data} = UseData()

    return (
        <form onSubmit={(event) => { event.preventDefault() }} className='form_'>
            <Name />
            <FullName/>
            Name : {data.name}
            <br/>
            Full Name : {data.fullName}
        </form>
    )
}
